var e="undefined"!=typeof globalThis?globalThis:"undefined"!=typeof self?self:"undefined"!=typeof window?window:"undefined"!=typeof global?global:{},a={},o={},n=e.parcelRequire1f3a;null==n&&((n=function(e){if(e in a)return a[e].exports;if(e in o){var n=o[e];delete o[e];var r={id:e,exports:{}};return a[e]=r,n.call(r.exports,r,r.exports),r.exports}var s=new Error("Cannot find module '"+e+"'");throw s.code="MODULE_NOT_FOUND",s}).register=function(e,a){o[e]=a},e.parcelRequire1f3a=n),n.register("1WG2w",(function(e,a){e.exports=JSON.parse('[{"id":"1","nom":"Level 42","components":["Mark King","Mike Lindup","Philip Gould","Boon Gould"],"estil":"Jazz Funk, Rock, Acid Jazz, Synthpop","anyFundacio":"1979","historia":"Level 42 se formó en 1979 como una banda que fusionaba el jazz y el funk.<br><br> En principio la banda firmó con una pequeña discográfica independiente, Elite Records.<br><br> Poco después lanzaron el sencillo \'Love meeting Love\' en Elite Records, lo cual llamó la atención de Polydor Records y firmaron con esta.<br><br> Uno de los colaboradores de su nueva andadura, el teclista Wally Badarou, más tarde se convertiría por años en el coproductor de Level 42 y que Mark King llamaría el \'quinto miembro\' de la banda, pese a que tenía otros compromisos que le impedía ir de gira.<br><br> En 1981 sacaron \'Love Games\', un éxito con el que coparon las listas de ventas; poco después lanzaron el álbum del mismo nombre, que fue un gran éxito en toda Europa.<br><br> Al año siguiente, se hizo un segundo álbum The Pursuit of Accidents, y sencillos del álbum: el primero \'Weave Your Spell\' y luego salió \'The Chinese Way\', el último en particular llegó muy lejos en las listas de ventas, ganando en audiencia y en éxito.<br><br> Entre tanto, Polydor lanzó The Early Tapes, grabado en tiempos en que la banda firmó con el sello discográfico Elite.<br><br> Un cuarto álbum Standing in the Light colocó entre los diez primeros de las listas el éxito \'The Sun Goes Down (Living It Up)\' en Reino Unido en 1983.<br><br> Grabado con los miembros de Earth, Wind and Fire, este álbum abrió una nueva era en la banda, menos experimental y de estilo jazz que sus anteriores lanzamientos.<br><br> No había piezas enteramente instrumentales en este álbum y ninguno de los siguientes álbumes hasta el Staring at the Sun en 1988.<br><br> El cuarteto prosiguió con el álbum True Colours en 1984, el cual mezclaba estilos funk, pop, midtempo rock y baladas melosas.<br><br> Dio paso a los sencillos \'The Chant Has Begun\' y \'Hot Water\'.<br><br> En ese mismo año, Mark King estaba inmerso en un proyecto en solitario: Influences.<br><br> Además, el grupo fue aclamado también por sus poderosos directos en el escenario (como el directo grabado en álbum Physical Presence).<br><br> El siguiente álbum hecho en estudio fue World Machine, que salió en 1985.<br><br> Los sencillos de éste, \'Something About You\' y \'Leaving Me Now\' fueron éxitos entre los diez primeros en las listas, seguido por otro, \'Lessons in Love\', a principios de 1986.<br><br> Por entonces, la banda se alejó de su estilo jazz-funk y su tendencia fue el sonido pop.<br><br> Elementos de las raíces de Level 42 todavía podían apreciarse en el funky \'Coup d\'Etat\' y \'Dream Crazy\' en la versión británica del álbum, así como una larga pista instrumental llamada \'Hell\'.<br><br> Esta última pista del álbum no vio la luz del día hasta principios de 2000 como una descarga de MP3 en el antiguo Napster.<br><br> El álbum Running in the Family, 1987, se convirtió en su disco más vendido, y sentó las bases del estilo musical pop, con el bajo de Mark King, Lindup y los sonidos del teclista Badarou sirviendo como plantillas, para dar canciones pop acertadas como \'To Be With You Again\', \'Lessons in Love\', la balada \'It\'s Over\' y el tema homónimo del álbum \'Running In The Family\' Tanto Philip como Boon dejaron el grupo, descontentos por la creciente tendencia hacia la música pop y agotados por las giras.<br><br> Entonces, King contrató a Gary Husband y a Steve Topping para reemplazarlos.<br><br> Husband recomendó a Topping, pero éste no se entendió bien con King debido a diferencias de personalidad.<br><br> El guitarrista Alan Murphy se unió al grupo, exintegrante de la banda Go West.<br><br> También había tenido el guitarrista de estudio de Kate Bush.<br><br> El nuevo álbum de Level 42 Staring at the Sun salió a la venta en 1988.<br><br> Al año siguiente, Alan falleció de neumonía según el parte médico en el hospital inglés \'Westminster City Hospital\' .<br><br>Su sistema inmunológico era muy débil a causa de haber consumido drogas , las cuales destruyeron su sistema inmunológico y la banda desapareció por un tiempo.<br><br> Entonces, se sacó al mercado Level Best, una recopilación con los grandes éxitos.<br><br> En diciembre de 1990, la banda tocó unos conciertos en el Hammersmith Odeon de Londres, el cual ya había sido reservado dos años antes.<br><br> Estos conciertos los caracterizaban Lyndon Connah en teclados y voces y Allan Holdsworth en la guitarra.<br><br> En este año, Mike Lindup sacó también su álbum debut en solitario Changes.<br><br> Durante principios de los 1990s, el grupo intentó extraer más de su recientes influencias musicales, como las de Mahavishnu Orchestra, pidiendo al músico Allan Holdsworth para aportar unos toques sorprendentes de guitarra para el álbum Guaranteed (sobre todo a \'A Kinder Eye\').<br><br> Pese a la buena acogida, especialmente de los críticos de la música de Estados Unidos, muchos de sus incondicionales del jazz-funk no les gustó su estilo rock-pop.<br><br> El álbum no se vendió tan bien como se esperaba a pesar de haber realizado musicalmente el trabajo más sofisticado y elaborado por Level 42 hasta la fecha.<br><br> Sin embargo, la banda continuaba teniendo un potente directo en los escenarios, con miembros como Annie McCaig, que también hacía de voz de fondo en el álbum Guaranteed, y el dúo formado por el saxofonista Gary Barnacle y el trompetista John Thirkell, de los The Hen Pecked Horns.<br><br> Además, Barnacle tocó en varios álbumes de estudio de los Level 42.<br><br> Barnacle había sido antecedido como saxofonista de la gira por Krys Mach, quien también grabó con Level 42 y estuvo de gira con el grupo de 1984 a 1988.<br><br> Después de grabar Guaranteed y de una gira promocional de una semana, Holdworth, resuelto a no tocar más la guitarra, dejó la banda y fue reemplazado por Jakko Jakszyk.<br><br> Aunque no en la grabación, Jakszyk figuró en la foto del álbum; también formó parte de promociones y en la gira para el álbum.<br><br> Fue protagonista en canciones como \'At the Great Distance\' y \'As Years Go By\'.<br><br> Trabajos de estudio con Level 42 vinieron en forma de dos pistas (\'Fire\' y \'Free Your Soul\') que se incluyeron en los álbumes Guaranteed y Forever now respectivamente.<br><br> El álbum Forever Now de 1994, marcó el retorno de Philip Gould como percusionista de estudio y principal compositor de letras.<br><br> En el álbum se vio que el grupo se acercaba a sus raíces Rythm&Blues-jazz, sobre todo en la balada \'Romance\', en la canción con influencias de acid-jazz \'Sunbed Song\' y la dance-pop \'Learn to Say No\'.<br><br> Con un álbum más que se requería como parte del acuerdo que tenía la banda con RCA Records, los incondicionales vieron un futuro prometedor para la banda, especialmente con el retorno Philip Gould y los halagos de la crítica musical con Forever Now; sin embargo, la fructífera reunión duró muy poco.<br><br> Phil Gould, consternado por la ineptitud de la compañía discográfica, no continuó el camino emprendido con la banda y su gira Forever Now; anunció su retirada en medio de la gira.<br><br> Esto pudo significar el fin de la banda.<br><br> En 1998, Mark King lanzó su segundo álbum en solitario One Man con letras de Boon Gould.<br><br> En 1999, King volvió con nuevas composiciones y algunas de Level 42.<br><br> A últimos 2001 llegó a un acuerdo con Mike Lindup y para renombrar su banda como \'Level 42\'.<br><br> Generalmente, este nuevo elenco estaba formado por King, el batería Gary Husband, Nathan King en guitarras y voces, Lyndon Connah en los teclados y voces y Sean Freeman en el saxofón y voces.<br><br> Nuevas noticias en la web Level42.<br><br>com (mayo de 2006) hablan de un cambio de Lyndon por Mike Lindup en los teclados.<br><br> En agosto de 2000, se reunieron tres cuartas partes del elenco de Level 42 para un concierto privado.<br><br> Philip Gould invitó a algunos amigos músicos para tocar en una fiesta, incluyendo a su hermano Boon y Mike Lindup.<br><br> Dos años más tarde, King, Lindup y Philip Gould tocaron juntos (en la boda de Lindup) por primera vez en diez años.<br><br> Esto les llevó a un intento de juntarse de nuevo como en sus inicios con Baradou.<br><br> Sin embargo, la formación duró poco y viejas rencillas comenzaron a resurgir.<br><br> El catalizador fue King en su empeño del control sobre la banda.<br><br> Aunque el grupo decidió no reagruparse, Boon Gould y Mike Lindup contribuyeron en su nuevo álbum, dirigido por King, pero con contribuciones de muchos integrantes de la banda en distintas épocas.<br><br> El núevo álbum, Retroglide, previsto el lanzamiento para el 11 de septiembre de 2006, se anunció en febrero de 2006 con una gira por el Reino Unido, Holanda, Alemania y otros países europeos en octubre/noviembre de 2006 con Mike Lindup como invitado especial.<br><br>","discografia":[{"album":"Level 42","any":"1980"},{"album":"Strategy/The Early Tapes","any":"1982"},{"album":"The Pursuit of Accidents","any":"1983"},{"album":"Standing in the Light","any":"1983"},{"album":"True Colours","any":"1984"},{"album":"World Machine","any":"1985"},{"album":"Running In The Family","any":"1987"},{"album":"Staring At The Sun","any":"1988"},{"album":"Guaranteed","any":"1991"},{"album":"Forever Now","any":"1994"},{"album":"Retroglide","any":"2006"},{"album":"Sirens","any":"2013"}],"fotoGrup":"level42.jpg","web":"level42.com","credits":"wikipedia"},{"id":"2","nom":"Coldplay","components":["Chris Martin","Jonny Buckland","Guy Berryman","Will Champion"],"estil":"Pop rock,rock alternativo, post-britpop, pop","anyFundacio":"1996","historia":"Coldplay es una banda de rock británica formada en Londres en 1996. Está formada por el vocalista y pianista Chris Martin, el guitarrista Jonny Buckland, el bajista Guy Berryman, el baterista Will Champion y el director creativo Phil Harvey. Se conocieron en University College London y comenzaron a tocar música juntos desde 1996 hasta 1998, primero llamándose a sí mismos Pectoralz y luego Starfish. <br> Después de lanzar de forma independiente un EP, Safety (1998), Coldplay firmó con Parlophone en 1999. El álbum debut de la banda, Parachutes (2000), incluyó su exitoso sencillo \'Yellow\' y recibió un Brit Award por Álbum Británico del Año, un Grammy Premio al Mejor Álbum de Música Alternativa y nominación al Premio Mercury. Su segundo álbum, A Rush of Blood to the Head (2002), ganó los mismos elogios e incluyó los sencillos \'The Scientist\' y \'Clocks\', y este último ganó un premio Grammy por Grabación del año. Destacado por una producción problemática, el tercer álbum de la banda, X&Y (2005), fue el más vendido del año en todo el mundo, un logro repetido por su sucesor, Viva la Vida or Death and All His Friends (2008), que los vio explorar nuevos estilos musicales. territorio tras la finalización de lo que se consideró una trilogía. Recibió un premio Grammy al Mejor Álbum de Rock y su primera nominación al Álbum del Año, mientras que la canción principal se convirtió en el primer sencillo de un grupo británico en alcanzar el número uno tanto en el Reino Unido como en los Estados Unidos en el siglo XXI. <br> Desde entonces, Coldplay diversificó aún más su sonido con los lanzamientos posteriores Mylo Xyloto (2011), Ghost Stories (2014), A Head Full of Dreams (2015), Everyday Life (2019) y Music of the Spheres (2021). Cada álbum presentaba un tema único y añadía nuevos estilos musicales al repertorio original de la banda, incluyendo electrónica, ambient, pop, R&B, funk, clásica, jazz fusión y rock progresivo. También son conocidos por sus presentaciones en vivo \'eufóricas\',que NME dijo que es cuando la banda \'cobra vida y tiene más sentido\'. Para celebrar su vigésimo aniversario en 2018, se estrenó en cines seleccionados un documental que abarca toda la carrera dirigido por Mat Whitecross, que presenta imágenes detrás de escena nunca antes vistas. <br>Con 100 millones de álbumes vendidos en todo el mundo, Coldplay es la banda más exitosa del siglo XXI y uno de los actos musicales más vendidos de todos los tiempos.Nota Según Fuse, también es el sexto grupo más premiado de la historia. Otros logros notables incluyen la sexta gira más taquillera de todos los tiempos, tres de los 50 álbumes más vendidos en el Reino Unido, la mayor cantidad de discos número uno en el país sin perder nunca la cima,la mayoría de las nominaciones y victorias para una banda en la historia de los Brit Awards y convertirse en el primer grupo británico en debutar en el número uno en el Billboard Hot 100. Coldplay también se considera una de las bandas más influyentes del siglo XXI, y Forbes los describe como el estándar. para la escena alternativa actual. El Salón de la Fama del Rock and Roll incluyó A Rush of Blood to the Head en su lista de \'200 Álbumes Definitivos\' y el sencillo \'Yellow\' forma parte de su exhibición \'Songs That Shaped Rock and Roll\' por ser uno de los más exitosos y grabaciones importantes en la industria. A pesar de su popularidad e impacto, Coldplay se ha ganado la reputación de ser íconos musicales polarizantes.","discografia":[{"album":"Parachutes","any":"2000"},{"album":"A Rush of Blood to the Head","any":"2002"},{"album":"X&Y","any":"2005"},{"album":"Viva la Vida or Death and All His Friends","any":"2008"},{"album":"Mylo Xyloto","any":"2011"},{"album":"Ghost Stories","any":"2014"},{"album":"A Head Full of Dreams","any":"2015"},{"album":"Everyday Life","any":"2019"},{"album":"Music of the Spheres","any":"2021"}],"fotoGrup":"coldplay.jpg","web":"coldplay.com","credits":"wikipedia"},{"id":"3","nom":"Bee Gees","components":["Barry Gibb","Robin Gibb","Maurice Gibb"],"estil":"Discopop, rockpop, pop, barrocopop, psicodélicosoft, rock","anyFundacio":"1958","historia":"Bee Gees fue un grupo musical británico de pop rock formado por los hermanos Barry, Robin y Maurice Gibb en 1958. Conocidos como los «reyes de la música disco», gozaron de su mayor fama entre 1967 y 1979, con varios temas donde destaca el característico falsete del grupo.<br><br>En el álbum doble Saturday Night Fever, banda sonora de la película homónima, los Bee Gees aportaron las seis canciones principales. Al vender más de 22 millones de copias, se convirtieron en uno de los grupos más exitosos de toda la historia de la música.<br><br>Algunas de sus canciones más populares son: How deep is your love, How Can You Mend a Broken Heart, To Love Somebody, I Started a Joke, Words, Massachusetts, Nights on Broadway, Jive Talkin\', Wind of change, More than a woman, Night Fever, Run to Me, Stayin\' Alive, Tragedy, Too Much Heaven, Alone, You Win Again, You Should Be Dancing, Still Waters, I surrender, entre otras.<br><br>Billboard situó tres de sus sencillos entre los mejores de todos los tiempos en el listado Hot 100 y ubicó a How deep is your love, Night Fever y Stayin Alive en las posiciones #25, #42 y #59.<br><br>Los Bee Gees abarcaron gran parte de la escena musical, en especial con la fiebre disco durante la segunda mitad de los 1970, de la mano del productor Robert Stigwood. Se ubican entre los más importantes artistas del género musical. Su gran influencia en la industria musical fue reconocida en 2003, al convertirse en la primera y hasta hoy única banda en poseer un premio Grammy Legend.<br><br>La banda cesó su actividad en 2003 tras la muerte del hermano menor, Maurice. Como supervivientes, Barry y Robin anunciaron que el nombre Bee Gees ya no se usaría en presentaciones tras la pérdida de un integrante; sin embargo, el 7 de septiembre de 2009, Robin le reveló a Jonathan Agnew que estuvo hablando con Barry y decidieron volver a los escenarios. Luego, en 2012 falleció Robin tras una lucha con el cáncer y, con Barry solo, la etapa de los Bee Gees se cerró definitivamente.<br><br>Bee Gees fue uno de los grupos más exitosos en la historia de la música, con más de 40 años de actividad ininterrumpida. Han vendido más de 220 millones de copias a nivel mundial, entre álbumes y sencillos.","discografia":[{"album":"The Bee Gees Sing and Play 14 Barry Gibb Songs","any":"1965"},{"album":"Spicks and Specks","any":"1966"},{"album":"Bee Gees\' 1st","any":"1967"},{"album":"Horizontal","any":"1968"},{"album":"Idea","any":"1968"},{"album":"Odessa ","any":"1969"},{"album":"Cucumber Castle","any":"1970"},{"album":"2 Years On","any":"1970"},{"album":"Trafalgar","any":"1971"},{"album":"To Whom It May Concern","any":"1972"},{"album":"Life in a Tin Can","any":"1973"},{"album":"Mr. Natural","any":"1974"},{"album":"Main Course","any":"1975"},{"album":"Children of the World","any":"1976"},{"album":"Saturday Night Fever","any":"1977"},{"album":"Spirits Having Flown","any":"1979"},{"album":"Living Eyes","any":"1981"},{"album":"E.S.P.","any":"1987"},{"album":"One","any":"1989"},{"album":"High Civilization","any":"1991"},{"album":"Size Isn\'t Everything","any":"1993"},{"album":"Still Waters","any":"1997"},{"album":"This Is Where I Came In","any":"2001"}],"fotoGrup":"beegees.jpg","web":"beegees.com","credits":"wikipedia"},{"id":"4","nom":"Eagles","components":["Don Henley","Joe Walsh","Timothy B. Schmit"],"estil":"Rock ,Country rock, Hard rock, Soft rock","anyFundacio":"1971","historia":"Eagles es una banda estadounidense de country rock y hard rock formada en Los Ángeles, California, EE. UU., en 1971, hasta el 2016, en que finalizó la carrera de la banda, con la muerte de uno de los fundadores y su vocalista Glenn Frey.1​La banda es mayormente conocida por su canción “Hotel California” de 1976, acreditada por Don Felder y Don Henley.<br><br>Inicialmente su música era una mezcla entre country e instrumentación bluegrass con armonías de surf rock californiano. El resultado fueron baladas sensibles y música con cierto toque country y pop rock. Sus letras hablaban de coches, relaciones y vidas sin rumbo. Los inventores de este género fueron cantautores como Gram Parsons, Jackson Browne, J.D. Souther y Warren Zevon.<br><br>Eagles encajaron el espíritu del cantautor en el marco de una formación musical, con un marcado énfasis en los arreglos y en la maestría musical, y el sonido inicial del grupo llegó a ser sinónimo del country rock del sur de California. En álbumes posteriores, el grupo prescindió de la instrumentación bluegrass y se movió hacia un sonido claramente más roquero.<br><br>Con cinco sencillos y seis álbumes números uno, Eagles están entre los más destacados grupos de estudio de los años 1970. Al final del siglo XX, dos de sus álbumes, Their Greatest Hits (1971-1975) y Hotel California, quedaron clasificados entre los 20 álbumes superventas de EE. UU., según la RIAA estadounidense. Asimismo, según la revista Rolling Stone en 2004, el álbum Hotel California está clasificado entre los 500 mejores de todos los tiempos, y el grupo ocupa el número 75 en la lista de los 100 mayores artistas de todos los tiempos.2​ Hasta la muerte de Michael Jackson en 2009, hecho que aumentó las ventas de su álbum Thriller, tenían en su haber el álbum más vendido de EE. UU.: Their Greatest Hits (1971-1975).<br><br>Eagles se separaron en 1980, pero volvieron a juntarse en 1994 para dar un concierto acústico, registrado en el álbum Hell Freezes Over, una mezcla de temas clásicos y nuevos. Han estado de gira desde entonces, y entraron en el Rock and Roll Hall of Fame en 1998. En 2007, Eagles lanzó Long Road Out of Eden, su primer álbum de estudio, después de 28 años. Al año siguiente emprendieron la gira Long Road out of Eden Tour, que transcurrió en el año 2009 a través de Norteamérica y Europa. El primer concierto fue el 20 de marzo del 2008 en Londres, Inglaterra, y el último el 22 de julio de 2009 en Lisboa, Portugal, dando dos conciertos adicionales el 17 y 20 de abril de 2010 en Los Ángeles, California.","discografia":[{"album":"Eagles","any":"1972"},{"album":"Desperado","any":"1973"},{"album":"On the Border","any":"1974"},{"album":"One of These Nights","any":"1975"},{"album":"Hotel California","any":"1976"},{"album":"The Long Run","any":"1979"},{"album":"Long Road Out Of Eden","any":"2007"}],"fotoGrup":"eagles.jpg","web":"eagles.com","credits":"wikipedia"}]')}));
